import React from 'react';
import MainPage from './MainPage';
import { Routes,Route } from 'react-router-dom';
import Subject from './Subject';

const App = () => {


  return (
    <div>
      <MainPage/>
      <Routes>
        <Route path='/Subject' Component={Subject}></Route>
      </Routes>
    </div>
  )
}

export default App
